class QuestionLetter extends React.Component {
  render(){
    return(
      <div className="ui centered card">
        <p id="question-letter">
          {this.props.generateQuestionLetter()}
          {this.props.update}
        </p>
      </div>
    )
  }
}

export default QuestionLetter
